import React from 'react';

function PopupModal() {
  return (
    <div id="1337Modal" className="modal">
      <div className="modal-content">
        <h3>Här kan ma va!</h3>
        <p>och här kan man va</p>
        <p>- Björn Gustafsson</p>
      </div>
    </div>
  );
}

export default PopupModal;
